import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19/Generic/GWBleedingHero_ENG_COVIDUPDATE__XSite_1500x600_PV_en-GB._CB428684220_.jpg"
        alt=""
      />

      {/* Product Comp */}
      {/* id, title,price, rating, image */}
      <Product
        id="12321341"
        title="The Lean Startup: How constant innovation
        works"
        price={35.64}
        rating={5}
        image="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages-na.ssl-images-amazon.com%2Fimages%2FI%2F81-QB7nDh4L.jpg&imgrefurl=https%3A%2F%2Fwww.amazon.ca%2FLean-Startup-Entrepreneurs-Continuous-Innovation%2Fdp%2F0307887898&tbnid=S821FdAakem-KM&vet=12ahUKEwijubalp5zvAhXLJ6wKHSDBBwMQMygBegUIARCaAg..i&docid=V4JtjUraL9peDM&w=1688&h=2550&q=the%20lean%20startup%20price&ved=2ahUKEwijubalp5zvAhXLJ6wKHSDBBwMQMygBegUIARCaAg"
      />
    </div>
  );
}

export default Home;
